INSERT INTO `advice_templates` (`id`, `d_id`, `title`, `description`, `showStatus`, `created_at`, `updated_at`) VALUES
(1, '7', 'Ext', 'দাঁত তোলার পর করনীয়ঃ\r\nক্ষতস্থানের তুলা ৬০ মিনিট কামড় ফিয়ে ধরে রাখবেন।\r\nব্যাথা না থাকলে ২নং ঔষধ খাওয়ার প্রয়োজন নাই।\r\n২৪ ঘণ্টা গরম খাবার ও পাণীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা করে খাবার খাবেন।\r\n২৪ ঘণ্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ - এতে রক্তপাত বেশী হতে পারে।\r\n২৪ ঘণ্টা প র থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবণ মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-05-10 11:22:30', '2023-09-07 14:04:45'),
(2, '7', 'Ext(C)', 'বাচ্চাদের দাঁত তোলার পরে করনীয়ঃ\r\nক্ষতস্থানের তুলা ৩০ মিনিট কামড় দিয়ে ধরে রাখবেন।\r\nস্থানীয় চেতনানাশক (Local anesthesia) দেয়া হলে বাচ্চাকে অন্তত ২ ঘণ্টা চোখে চোখে রাখুন যেন অবশ ঠোঁট বা গালে কামড় না দেয়।\r\n২৪ ঘণ্টা গরম খাবার ও পানীয় গ্রহণ করবেন না, স্বাভাবিক অথবা ঠান্ডা করে খাবার খাবেন।\r\n২৪ ঘণ্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ - এতে রক্তপাত বেশী হতে পারে।\r\n২৪ ঘণ্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা পানিতে লবণ মিশিয়ে দিনে ১০-১২ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-05-10 13:54:29', '2023-05-28 03:56:50'),
(3, '9', 'R.T', '1. Brush Your Teeth at least twice a day.\r\n2. Floss once daily.\r\n3. Brush your tounge.\r\n4. Visit your Dentist regularly.\r\n5. Avoid Smoking & Tobacco product.', 1, '2023-05-21 14:21:53', '2023-05-21 14:21:53'),
(4, '9', 'R.T', '1. Brush Your Teeth at least twice a day.\r\n2. Floss once daily.\r\n3. Brush your tounge.\r\n4. Visit your Dentist regularly.\r\n5. Avoid Smoking & Tobacco product.', 1, '2023-05-21 14:21:53', '2023-05-21 14:21:53'),
(5, '9', 'R.T', '1. Brush Your Teeth at least twice a day.\r\n2. Floss once daily.\r\n3. Brush your tounge.\r\n4. Visit your Dentist regularly.\r\n5. Avoid Smoking & Tobacco product.', 1, '2023-05-21 14:21:54', '2023-05-21 14:21:54'),
(6, '7', 'OHI', 'দাঁতের যত্নে করনীয়ঃ\r\nপ্রতিদিন রাতে ঘুমাবার পূর্বে ও সকালে নাস্তা করার পরে টুথপেস্ট ও নরম ব্রাশ দিয়ে দাঁত পরিষ্কার করবেন।\r\nদুই দাঁতের মাঝে যেখানে খাবার জমে, দুপুর ও রাতে খাবারের পরে ডেন্টাল ফ্লস ব্যবহার করে প্রতিদিন ফ্লসিং করবেন।\r\nমাউথ ওয়াশ / হালকা গরম ১ গ্লাস পানিতে ১ চামচ লবণ মিশিয়ে নিয়মিত ২ বার কুলকুচি করবেন।', 1, '2023-05-28 04:02:01', '2023-05-28 04:02:01'),
(7, '33', 'Scaling', '1. Rinse your gums with warm salt water.\r\n2. Be gentle when brushing.\r\n3. Avoid tobacco and smoking.\r\n4. Careful about water and spicy food.\r\n5. Use mouthwash and soft bristle brush', 1, '2023-06-24 12:29:31', '2023-06-24 12:29:31'),
(8, '33', 'Ext', '1. Remove cotton after 30 min.\r\n2. Eat soft and cold food for 24 hour.\r\n3. Avoid hot and solid food for 24 hour.\r\n4. After 24 hrs, gargle with warm salt water in 3 times daily\r\n5. If sutures are given, after 5-7 day will come to cut the stitches.\r\n6. Take the medicine as prescribed by the doctor.', 1, '2023-06-24 12:46:52', '2023-06-24 12:46:52'),
(9, '33', 'RCT', '1. Remove cotton after 20 min.\r\n2. Eat soft food.\r\n3. Gargle with warm salted water.\r\n4. eating ice cream and using cold compresses will help to keep the swelling down following RCT procedure.\r\n5. Avoid drinking hot drinks, smoking etc. \r\n6. Avoid eating foods that can get stuck between teeth until healing is complete.\r\n7. Carefull when brushing the tooth.\r\n8. continue eating your medication as prescribed.', 1, '2023-06-24 13:02:36', '2023-06-24 13:02:36'),
(10, '33', 'Test', '1. CBC- Hb, ESR, SGPT, SGOT\r\n2. BT, CT\r\n3. HbA1c\r\n4. RBS\r\n5. HBsAg\r\n6. Serum Creatinine\r\n7. RAT ( For COVID-19)', 1, '2023-06-24 13:35:50', '2023-06-24 13:35:50'),
(11, '32', 'GENERAL', '1. BRUSH YOUR TEETH TWICE DAILY AFTER BREAKFAST AND BEFORE GOING TO BED AT NIGHT ACCRODINGLY PROPER WAY.\r\n\r\n2. USE INTERDENTAL OR DENTAL FLOSS TO CLEAN THE INTER DENTAL SPACES IN BETWEEN TEETH , 2-3 TIMES IN A  WEEK ACCRODING TO THE PROPER WAY.\r\n\r\n3. IF ANY PROBLEM CONSULT IMMEDIATELY TO YOUR DOCTOR.\r\n\r\n4. VISIT OUR CHAMBER EVERY 6 MONTHS INTERVAL FREE OF COST', 1, '2023-06-25 07:54:37', '2024-02-04 23:22:18'),
(12, '50', 'Aftr ext', 'দাঁত তোলার পর করনীয়ঃ\r\n১। ক্ষতস্থানের তুলা ৬০ মিনিট কামড় ফিয়ে ধরে রাখবেন।\r\n২। ২৪ ঘণ্টা গরম খাবার ও পাণীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা করে খাবার খাবেন।\r\n৩। ২৪ ঘণ্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ - এতে রক্তপাত বেশী হতে পারে।\r\n৪। ২৪ ঘণ্টা প র থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবণ মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-07-10 08:45:17', '2023-07-10 08:45:17'),
(13, '34', 'ADVICE', '১।নিয়মিত ২ বার ব্রাশ ও ফ্লস করুন সকালে ও রাতে খ৷ওয়৷র পর।\r\n২।ফ্লোরাইড সমৃদ্ব যে কোন টুথপেষ্ট দাঁতের জন্য উপকারি।\r\n৩.২/৩ মাস অন্তর অন্তর অবশ্যই টুথব্রাশ বদলাবেন।\r\n৪।উষঞ গরম পানিতে লবণ মিশিয়ে কুল্কুচি করবেন দিনে ২/৩ বার।\r\n৫।লেবু,আমলকী,কমলা,টমেটো ও বিভিন্ন ধরনের শাক সবজিতে প্রচুর পরিমানে VIT-C ও অন্যান্য ভিটামিন থাকে। VIT-C দাঁত ও মাড়ির জন্য উপকারী।\r\n৬। মুখের দুগন্ধ দূরীকরণে ম৷উথ ওয়৷শ ব্যাবহার করুন।', 1, '2023-08-05 15:49:03', '2023-08-07 07:10:58'),
(14, '34', 'EXT', 'দাঁত তোলার পর করনীয়ঃ\r\n\r\n১। ক্ষতস্থানের তুলা ৬০ মিনিট কামড় ফিয়ে ধরে রাখবেন।\r\n২। ২৪ ঘণ্টা গরম খাবার ও পাণীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা করে খাবার খাবেন।\r\n৩। ২৪ ঘণ্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ - এতে রক্তপাত বেশী হতে পারে।\r\n৪। ২৪ ঘণ্টা প র থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবণ মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-08-05 16:35:41', '2023-08-06 14:09:05'),
(15, '34', 'muthwash', 'ম৷উথ ওয়৷শ ব্যাবহারের নিয়ম :\r\n\r\n*চার চা চামচ (২০ মিলিলিটার) পরিমাণ ম৷উথ ওয়৷শ একটি কাপে নিতে হবে।\r\n\r\n*কাপ থেকে ম৷উথ ওয়৷শ মুখে নিতে হবে।\r\n\r\n* এটি মুখে ৩০ সেকেন্ড ধরে রাখতে হবে।\r\n\r\n* যখন মুখে মাউথ ওয়াশ থাকবে,তখন গারগল করতে হবে।\r\n\r\n*অতঃপর মাউথ ওয়াশ বেসিনে ফেলে দিতে হবে।\r\n\r\nম৷উথ ওয়৷শ ব্যাবহারে সতর্কতা:\r\n\r\n* ছয় বছরের নিচে বাচ্চাদের ব্যাবহার করা সঠিক নয়।\r\n\r\n* ফ্লোরহেক্সিডিনে এলাজি্ থাকলে মাউথ ওয়াশ ব্যাবহার করা যাবেনা।\r\n\r\n* প্রতিদিন ৩০ সেকেন্ড সময় ধরে ব্যাবহার করতে হবে।\r\n\r\n* মাউথ ওয়াশ গিলে ফেলা যাবে না।\r\n\r\n* দাঁত ব্রাশ করার পর মাউথ ওয়াশ ব্যাবহার করতে হবে।\r\n\r\n* টানা ৩ সপ্তাহের অধিক মাউথ ওয়াশ ব্যাবহার করা যাবে না।\r\n\r\n* গভ্বতী মায়েদের ক্ষেত্রে ডাক্তারের পরামর্শে ব্যাবহার করা উচিত।\r\n\r\n* বুকের দুধদানকারীদের মাউথ ওয়াশ ব্যাবহারের ক্ষেত্রে ডাক্তারের পরামর্শ নিতে হবে।', 1, '2023-08-07 07:09:31', '2023-08-07 07:09:31'),
(16, '56', 'TOOTH', 'তুলা ৩০ মিনিট পর ফেলুন\r\n ২৪ ঘণ্টা জোড়ে কুলি করবেন না\r\n২৪ ঘণ্টা শক্ত ও গরম খাবার গ্রহণ করবেন না   \r\n ২৪ ঘণ্টা পর্যন্ত নরম ও ঠাণ্ডা খাবেন\r\n তুলা ফেলে দেয়ার পর ঠাণ্ডা পানি দিয়ে কুলি করবেন\r\n ২৪ ঘণ্টা পর থেকে হালকা  লবণ গরম পানি দিয়ে নিয়মিত ৪/৫ বার কুলি করুন ৭ দিন \r\nনিয়মিত ঔষধ খাবেন \r\n ৭ দিন পর সেলাই কাটতে আসবেন / দেখা করবেন', 1, '2023-09-19 05:15:11', '2023-09-19 05:52:08'),
(17, '56', 'উপদেশ', '২ নং   ঔষধ  ব্যথা হলে খাবেন', 1, '2023-09-30 04:51:25', '2023-10-21 05:51:29'),
(18, '56', 'OPG', 'OPG', 1, '2023-10-03 11:25:32', '2023-10-03 11:25:32'),
(19, '29', 'Ext', 'দাঁত তোলার পর করনীয়ঃ\r\n→ ক্ষতস্থানের তুলা ৬০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\nধূমপান ৪৮ ঘন্টা করা যাবেনা\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে\r\nহালকা গরম পানিতে লবন মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না\r\nথাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-10-30 13:37:05', '2023-11-02 05:27:26'),
(20, '29', 'PD/CD', 'ডেনচার / আলগা নকল দাঁতের যত্নঃ ডেঞ্চার বা আলগা দাঁত প্রতিদিন রাতে ঘুমাবার আগে খুলে পানি (Running tap water) দিয়ে ভালো ভাবে পরিস্কার করবেন।\r\nঘুমানোর সময় ডেঞ্চার/আল্পগা দাঁত খুলে একটি পানির পাত্রে ডুবিয়ে\r\nসংরক্ষন করবেন ।\r\nকোন কারনে ব্যবহার করতে অসুবিধা হলে পানিতে ডুবিয়ে সংরক্ষন করবেন শুকনো রাখবেন না।', 1, '2023-11-02 05:24:42', '2023-11-02 05:24:42'),
(21, '29', 'OHI', 'দাঁতের যত্নে করনীয়\r\n→ প্রতিদিন রাতে ঘুমাবার পূর্বে এবং সকালে নাস্তা করার পরে পেস্ট ও নরম ব্রাশ দিয়ে দাঁত পরিস্কার করবেন।\r\n→ দুই দাঁতের মাঝে যেখানে খাবার জমে - ডেন্টাল ফ্লস ব্যবহার করে দুপুর ও রাতে খাবার পরে প্রতিদিন ফ্লসিং করবেন\r\n→ মাউথ ওয়াশ / হালকা গরম ১ গ্লাস পানিতে ১ চামচ লবন মিশিয়ে নিয়মিত 2 বার কুলকুচি করবেন', 1, '2023-11-02 05:25:24', '2024-01-09 14:12:30'),
(22, '29', 'Ext (C)', 'বাচ্চাদের দাঁত তোলার পরে করনীয়:\r\n→ ক্ষতস্থানের তুলা ৩০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ স্থানীয় চেতনানাশক (Local Anesthesia) দেয়া হলে বাচ্চাকে অন্তত ২ ঘন্টা চোখে চোখে রাখুন যেন অবশ ঠোঁট বা গালে কামড় না দেয়।\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবন মিশিয়ে দিনে ১০-১২ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2023-11-02 05:26:12', '2023-11-02 05:26:12'),
(23, '83', 'Ex Ad', '১। তুলা ৪৫ মিনিট পর ফেলে দিয়ে ঠান্ডা কাপ আইসক্রিম খাবেন।\r\n২। ২৪ ঘন্টা পর থেকে কুসুম গরম পানি সাথে লবন মিশিয়ে দিনে ৮/১০ বার কুলিকুচি করবেন।\r\n৩। আগামী দুই সপ্তাহ নরম ও তরল খাবার খাবেন।\r\n৪। দুই সপ্তাহ পর আবার দেখা করবেন।\r\n৫। ব্যথা হলে ২ নং ঔষধ খাবেন।', 1, '2023-12-19 12:32:45', '2023-12-19 12:32:45'),
(24, '4', 'S Ext', 'উপদেশ :\r\nদাঁত তোলার পর করনীয়ঃ\r\n→ ক্ষতস্থানের তুলা ৬০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\nধূমপান ৪৮ ঘন্টা করা যাবেনা\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে\r\nহালকা গরম পানিতে লবন মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না\r\nথাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2024-01-09 11:03:58', '2024-01-09 11:03:58'),
(25, '4', 'OHI', 'দাঁতের যত্নে করনীয়\r\n→ প্রতিদিন রাতে ঘুমাবার পূর্বে এবং সকালে নাস্তা করার পরে পেস্ট ও নরম ব্রাশ দিয়ে দাঁত পরিস্কার করবেন।\r\n→ দুই দাঁতের মাঝে যেখানে খাবার জমে - ডেন্টাল ফ্লস ব্যবহার করে দুপুর ও রাতে খাবার পরে প্রতিদিন ফ্লসিং করবেন\r\n→ মাউথ ওয়াশ / হালকা গরম ১ গ্লাস পানিতে ১ চামচ লবন মিশিয়ে\r\nনিয়মিত 2 বার কুলকুচি করবেন', 1, '2024-01-09 11:04:45', '2024-01-09 11:04:45'),
(26, '32', 'VIODIN', 'VIODIN MOUTHWASH 0.1 % : LUKE WARM WATER = 1/2 : 1/2 \r\n\r\nRINSE YOUR MOUTH 2-3 TIMES A DAY FOR  5 /7/10 DAYS.', 1, '2024-01-26 23:47:06', '2024-02-04 23:20:01'),
(27, '32', 'STEROID', 'MOUTHWASH : ORYZA / BEN O STAR\r\n\r\n10 ML MOUTHWASH SHOULD BE RINSED ON YOUR MOUTH , 2-4 TIMES A DAY FOR  5 /7 /10 DAYS.', 1, '2024-01-26 23:48:47', '2024-01-26 23:48:47'),
(28, '32', 'T. PASTE', 'TOOTHPASTE : MEDIPLUS FLUORIDE GEL / PEPSODENT GUM CARE. ( ACCRODING TO THE PROPER WAY )\r\n\r\nTOOTH BRUSH : MEDIPLUS TOOTH BRUSH\r\n\r\nBRUSH YOUR TEETH TWICE DAILY AFTER BREAKFAST AND BEFORE GOING TO BED AT NIGH.  21 DAYS', 1, '2024-02-04 23:01:04', '2024-02-04 23:18:44'),
(29, '32', 'SALINE', 'RINSE YOUR MOUTH WITH LUKE SALINE WATER (WARM WATER WITH SALT), 3-4 TIMES A DAY. 5/7/10 DAYS.', 1, '2024-02-04 23:17:11', '2024-02-04 23:17:11'),
(30, '99', 'AFTEREXT', 'দাঁত ফেলার পর করনীয়ঃ\r\n তুলা ১ ঘণ্টা কামড় দিয়ে ধরে রাখবেন ।\r\nব্যথা না থাকলে   নং ওষুধ খাওয়ার প্রয়োজন নেই ।\r\n২৪ ঘন্টা গরম/শক্ত খাবার বা পানীয় গ্রহণ করবেননা, স্বাভাবিক বা ঠাণ্ডা করে খাবেন ।\r\n২৪ ঘণ্টা বারবার কুলি করা বা থু থু ফেলা নিষেধ - এতে রক্তপাত বেশী হতে পারে।\r\n২৪ ঘণ্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় হতে হালকা করে গরম পানিতে লবণ মিশিয়ে দিনে ৬/৭ বার কুলি করবেন । বিশেষ করে প্রতিবার খাও্যার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে । এভাবে ৭ দিন করবেন ।', 1, '2024-02-22 10:59:04', '2024-02-22 11:00:03'),
(31, '99', 'DENTURE', 'ডেনচার / আলগা নকল দাঁতের যত্নঃ ডেঞ্চার বা আলগা দাঁত প্রতিদিন রাতে ঘুমাবার আগে খুলে পানি (Running tap water) দিয়ে ভালো ভাবে পরিস্কার করবেন।\r\nঘুমানোর সময় ডেঞ্চার/আল্পগা দাঁত খুলে একটি পানির পাত্রে ডুবিয়ে\r\nসংরক্ষন করবেন ।\r\nকোন কারনে ব্যবহার করতে অসুবিধা হলে পানিতে ডুবিয়ে সংরক্ষন করবেন শুকনো রাখবেন না।', 1, '2024-02-22 11:00:42', '2024-02-22 11:00:42'),
(32, '99', 'OHI', 'oral hygiene instruction\r\nদাঁতের যত্নে করনীয়\r\n→ প্রতিদিন রাতে ঘুমাবার পূর্বে এবং সকালে নাস্তা করার পরে পেস্ট ও নরম ব্রাশ দিয়ে দাঁত পরিস্কার করবেন।\r\n→ দুই দাঁতের মাঝে যেখানে খাবার জমে - ডেন্টাল ফ্লস ব্যবহার করে দুপুর ও রাতে খাবার পরে প্রতিদিন ফ্লসিং করবেন\r\n→ মাউথ ওয়াশ / হালকা গরম ১ গ্লাস পানিতে ১ চামচ লবন মিশিয়ে\r\nনিয়মিত 2 বার কুলকুচি করবেন', 1, '2024-02-22 11:01:10', '2024-02-22 11:01:10'),
(33, '99', 'CHILDEXT', 'বাচ্চাদের দাঁত তোলার পরে করনীয়:\r\n→ ক্ষতস্থানের তুলা ৩০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ স্থানীয় চেতনানাশক (Local Anesthesia) দেয়া হলে বাচ্চাকে অন্তত ২ ঘন্টা চোখে চোখে রাখুন যেন অবশ ঠোঁট বা গালে কামড় না দেয়।\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবন মিশিয়ে দিনে ১০-১২ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, '2024-02-22 11:01:42', '2024-02-22 11:01:42'),
(34, '99', 'IF PAIN', '২ নং ওষুধ ব্যথা হলে খাবেন ।', 1, '2024-02-29 07:38:48', '2024-02-29 07:38:48'),
(35, '118', 'RCT', '1.DONT BITE ANY HARD OBJECT\r\n2.IF PAIN,TAKE MEDICATION', 1, '2024-05-01 14:08:44', '2024-05-01 14:08:44'),
(36, '133', 'OHI', 'Brush your teeth twice daily with Mediplus DS.\r\nFloss your teeth after meal.\r\nAvoid oily food.\r\nVisit your Dental Surgeon twice yearly', 1, '2024-05-15 13:26:45', '2024-05-15 13:26:45'),
(37, '134', 'Cap', '১। ক্যাপ বা Crown লাগানোর আধা ঘন্টা পর্যন্ত কোন পানি লাগানো যাবে না।\r\n২। ক্যাপ লাগানোর স্থানে শক্ত কোন খাবার খাওয়া যাবে না।\r\n৩। নিয়মিত দাঁত ব্রাশ ও ডেন্টাল\r\n৪। হালকা কুসুম গরম পানিতে পরিমান মত লবন দিয়ে ৭-১০ বার কুলিকুচি করতে হবে।\r\n৫। যে কোন অসুবিধা যেমন কামড় বা ঠিকমত চিবিয়ে খেতে গেলে অসুবিধা হলে ডাক্তারের সাথে দ্রুত যোগাযোগ করতে হবে।', 1, '2024-05-16 12:19:19', '2024-05-16 12:19:19');
