(7, '7', 1, NULL, NULL, 'টিউটোরিয়ালঃ ১\r\nতথ্য নিরাপত্তার নিশ্চিত করতে আপনার ডেন্টাল সফটওয়ার এর WRITE A PRESCRIPTION পেইজে PRINT বাটনের More setting অপশনে গিয়ে নিন্মক্ত স্টপগুলো ফলো করুন।\r\nWrite a prescription > Print > More setting > Option > Headers & footers \r\nযদি HEADERS & FOOTERS অপশনটিতে টিক থাকে তাহলে টিকটি উঠিয়ে দিন। এরপর PRINT করুন।', 0, 0, 0, 'f_p_20230511080520.jpg', 1, '2023-05-11 14:52:20', '2023-05-11 15:04:09'),
(8, '7', 1, NULL, NULL, 'টিউটোরিয়ালঃ ২\r\nসফটওয়ার আপডেট করার পর অনেক সময় আমাদের সফটওয়ার SYSTEM ERROR দেখায়। সেক্ষেত্রে নিচের স্টেপগুলো ফলো করুন।\r\nGOOGLE CHROME এর ক্ষেত্রেঃ\r\n1. ব্রাউজারের RIGHT কর্নারে তিনটা ডট আইকন-এ (Customize and Control Google Chrome) ক্লিক করুন।\r\n2. Select HISTORY -> new window popup\r\n3. Select HISTORY again -> new page open\r\n4. Select CLEAR BROWSING DATA -> new window popup\r\n5. Select ADVANCED option\r\n6. Select \"COOKIES AND OTHER SITE DATA\" & \"CHCHED IMAGES AND FILES\" option\r\n7. Click on CLEAR DATA\r\n8. Close Google Chrome & enter again.\r\nআশা করছি ERROR ISSUES আর থাকবে না।', 3, 0, 0, 'f_p_20230511100541.jpg', 1, '2023-05-11 16:34:41', '2024-02-19 11:46:29'),
(16, '29', 1, NULL, NULL, 'After Extraction Instruction (Female)\r\nউপদেশ :\r\nদাঁত তোলার পর করনীয়ঃ\r\n→ ক্ষতস্থানের তুলা ৬০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা করে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবন মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না\r\nথাকে। এভাবে ৭ দিন কুলি করবেন।', 2, 0, 0, '', 1, '2023-10-22 14:28:10', '2024-01-08 14:24:04'),
(17, '29', 1, NULL, NULL, 'Child After Ext. Advices\r\nউপদেশ :\r\nবাচ্চাদের দাঁত তোলার পরে করনীয়:\r\n→ ক্ষতস্থানের তুলা ৩০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ স্থানীয় চেতনানাশক (Local Anesthesia) দেয়া হলে বাচ্চাকে অন্তত ২ ঘন্টা চোখে চোখে রাখুন যেন অবশ ঠোঁট বা গালে কামড় না দেয়।\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে হালকা গরম পানিতে লবন মিশিয়ে দিনে ১০-১২ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না থাকে। এভাবে ৭ দিন কুলি করবেন।', 1, 0, 0, '', 1, '2023-10-22 14:29:29', '2024-02-19 11:45:55'),
(18, '29', 1, NULL, NULL, 'oral hygiene instruction\r\nদাঁতের যত্নে করনীয়\r\n→ প্রতিদিন রাতে ঘুমাবার পূর্বে এবং সকালে নাস্তা করার পরে পেস্ট ও নরম ব্রাশ দিয়ে দাঁত পরিস্কার করবেন।\r\n→ দুই দাঁতের মাঝে যেখানে খাবার জমে - ডেন্টাল ফ্লস ব্যবহার করে দুপুর ও রাতে খাবার পরে প্রতিদিন ফ্লসিং করবেন\r\n→ মাউথ ওয়াশ / হালকা গরম ১ গ্লাস পানিতে ১ চামচ লবন মিশিয়ে\r\nনিয়মিত 2 বার কুলকুচি করবেন', 2, 0, 0, '', 1, '2023-10-22 14:30:36', '2024-02-19 11:45:18'),
(19, '29', 1, NULL, NULL, 'PD/CD Advices\r\nডেনচার / আলগা নকল দাঁতের যত্নঃ ডেঞ্চার বা আলগা দাঁত প্রতিদিন রাতে ঘুমাবার আগে খুলে পানি (Running tap water) দিয়ে ভালো ভাবে পরিস্কার করবেন।\r\nঘুমানোর সময় ডেঞ্চার/আল্পগা দাঁত খুলে একটি পানির পাত্রে ডুবিয়ে\r\nসংরক্ষন করবেন ।\r\nকোন কারনে ব্যবহার করতে অসুবিধা হলে পানিতে ডুবিয়ে সংরক্ষন করবেন শুকনো রাখবেন না।', 2, 0, 0, '', 1, '2023-10-22 14:31:21', '2024-02-19 11:44:55'),
(20, '29', 1, NULL, NULL, 'After Extraction Instruction\r\nউপদেশ :\r\nদাঁত তোলার পর করনীয়ঃ\r\n→ ক্ষতস্থানের তুলা ৬০ মিনিট কামড় দিয়ে ধরে রাখবেন\r\n→ ২৪ ঘন্টা গরম খাবার ও পানীয় গ্রহন করবেন না, স্বাভাবিক অথবা ঠান্ডা\r\nকরে খাবার খাবেন।\r\n→ ২৪ ঘন্টা বারবার কুলি করা বা বারবার থুথু ফেলা নিষেধ -এতে রক্তপাত\r\nবেশি হতে পারে।\r\nধূমপান ৪৮ ঘন্টা করা যাবেনা\r\n→ ২৪ ঘন্টা পর থেকে গরম খাবার খাওয়া যাবে এবং সেই সময় থেকে\r\nহালকা গরম পানিতে লবন মিশিয়ে দিনে ৬/৭ বার কুলি করবেন। বিশেষ করে প্রতিবার খাওয়ার পরে কুলি করবেন যেন ক্ষতস্থানে কিছু জমে না\r\nথাকে। এভাবে ৭ দিন কুলি করবেন।', 5, 0, 0, '', 1, '2023-10-22 14:32:28', '2024-05-15 16:29:14'),
(21, '29', 1, NULL, NULL, 'অনেকেই প্রেস্ক্রিপশন প্রিন্ট এর ক্ষেত্রে মারজিনাল মিসম্যাচ এর ঝামেলার কথা বলছেন। প্রিন্ট অপশনে গিয়ে এই অপশনগুলো ফলো করে দেখেন ঝামেলাটা সলভ হচ্ছে কিনা। \r\nSelect Print,\r\n#Pages: select \"Odd  pages only\"\r\nClick on \"more settings\"\r\n#Paper size: select \"A4\"\r\n#Margins: select \"minimum\"\r\n#Quality: select \"Custom\"\r\n#Options: UNCLICK \"Headers & footers\"\r\nআশা করছি সমস্যাটির সমাধান হবে।', 6, 1, 0, 'f_p_20231104051109.jpg', 1, '2023-11-04 11:43:09', '2024-02-19 11:43:56'),
(23, '7', 4, 'RCT', '91,677', 'kkkk', 2, 0, 0, NULL, 1, '2023-12-06 13:00:43', '2024-05-15 16:27:17'),
(24, '29', 1, NULL, NULL, 'ট্রিট্মেন্ট নেম সার্চ অপশনের সিস্টেম আপগ্রেড এর কাজ চলছে।\r\nআগে যেমন সার্চ অপশনে অন্য ডাক্তারদের ট্রিটমেন্ট নেমগুলোও দেখা যেতো, আপগ্রেডের পর থেকে সম্মানিত ডাক্তারগন শুধুমাত্র তার ট্রিটমেন্ট লিস্টটাই দেখবেন।\r\nএই মুহূর্তে আপনারা নিজেরাও  নিজেদের লিস্ট বিল্ড করতে পারবেন।\r\nনিচের স্টেপগুলো ফলো করুন।\r\n> প্রথমে পেশেন্ট প্রোফাইল - যে কোন দাঁতের উপর ক্লিক করুন\r\n> নতুন ট্রিটমেন্ট প্লান এড করার জন্য (+) বাটনে ক্লিক করুন।\r\n> Enter treatment Name -এ ট্রিটমেন্ট নেম এড করুন। যেমন Scaling\r\n> Enter Cost -এ প্রাইস লিখেন। যেমন 500\r\n> Confirm করে বের হয়ে আসুন।\r\nআপনার প্রফাইল এর Settings অপশনে গিয়ে Treatment Cost এ যান।  (+) বাটনে ক্লিক করুন।\r\n> ট্রিট্মেন্ট নেম ও প্রাইস সিলেক্ট করে কনফার্ম করে বের হয়ে আসুন।\r\n> শুধু আপনার ট্রিটমেন্ট প্লান এর নামগুলই সার্চ ইঞ্জিনে পাবেন।\r\n\r\nধন্যবাদ।', 4, 0, 0, 'f_p_20240223010239.png', 1, '2024-02-23 07:00:39', '2024-04-25 12:40:00'),
