INSERT INTO `notices` (`id`, `admin_id`, `title`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, NULL, 'স্বাগতম!', 'রিফ্লেক্স ডেন্টাল নেটওয়ার্কে আপনাকে স্বাগতম।  ReflexDN ওয়েবএপ্লিকেশন এর মাধ্যমে আপনি আপনার চেম্বারের যাবতীয় তথ্য সর্বোচ্চ নিরাপত্তার সাথে নিশ্চিন্তে সংরক্ষণ করতে পারবেন।', 0, '2022-10-21 00:43:24', '2024-02-22 17:58:17'),
(3, NULL, 'Appointment system update !', 'Greetings Doctors,\r\n- You can book an appointment in our appointment system on any day of the year. The 5 day limit has been removed.\r\nThank you for supporting Reflex Dental Software. We hope you enjoy our system.\r\nTeam ReflexDN', 0, '2023-05-27 17:03:04', '2024-03-06 13:01:16'),
(5, NULL, 'Check Forum', 'You can copy-paste advice for prescriptions from the forum. You can also upload your version of advice.\r\nThank you, Dr. Md. Arifur Rahman, for providing these advices.', 0, '2023-11-08 08:18:11', '2024-02-22 17:58:23'),
(6, NULL, 'New UPDATE coming soon ! 23.02.2024', 'Greetings Doctors, \r\n* some bugs fixed\r\n* Treatment Card is now more smooth.\r\nThank you for supporting Reflex Dental Software. We hope you enjoy our system.\r\nTeam ReflexDN', 0, '2024-02-22 18:21:28', '2024-03-06 13:51:17'),
(7, NULL, 'National Dentist Day 6th March 2024', 'You all are the reason for all our smiles. We wish you all the best.\r\nTeam ReflexDN', 1, '2024-03-06 13:44:21', '2024-03-07 07:39:27'),
(8, NULL, 'ট্রিটমেন্ট প্লান আপডেট!', 'ট্রিটমেন্ট প্লান সিস্টেমে পরিবর্তন আনা হয়েছে। এখন থেকে ডাক্তারগন শুধুমাত্র তাদের নিজেদের ট্রিটমেন্ট লিস্ট দেখতে পারবেন। একই সাথে নতুন ট্রিটমেন্ট নেম ও ট্রিটমেন্ট খরচ পেশেন্ট প্রোফাইল থেকে সরাসরি এড করা যাবে।', 1, '2024-03-15 08:21:45', '2024-03-15 08:21:51');
